tables.table_schema:
CREATE TABLE leads (
    lead_id UUID PRIMARY KEY,
    lead_name STRING,
    lead_email STRING,
    lead_phone STRING,
    lead_score INT
);

CREATE TABLE lead_scores (
    score_id UUID PRIMARY KEY,
    lead_id UUID REFERENCES leads(lead_id),
    score_value INT,
    scored_date TIMESTAMP
);

CREATE TABLE lead_score_table (
    lead_id UUID PRIMARY KEY,
    lead_name STRING,
    lead_score INT
);

CREATE TABLE lead_details_table (
    lead_id UUID PRIMARY KEY,
    lead_email STRING,
    lead_phone STRING
);

CREATE TABLE sales_team_table (
    team_id UUID PRIMARY KEY,
    team_name STRING,
    team_manager STRING
);

CREATE TABLE lead_scores (
  lead_id INT PRIMARY KEY,
  lead_score INT
);

CREATE TABLE lead_details (
  lead_id INT PRIMARY KEY,
  lead_name VARCHAR,
  lead_email VARCHAR,
  lead_phone VARCHAR
);

CREATE TABLE lead_engagement (
  lead_id INT PRIMARY KEY,
  engagement_score INT,
  last_interaction_date TIMESTAMP
);

CREATE TABLE lead_segments (
  segment_id INT PRIMARY KEY,
  segment_name VARCHAR
);
